<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="utf-8">
    <title>MyWork</title>
    <base href="https://MarioBurgos.github.io/MyWork/">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="icon" type="image/x-icon" href="favicon.ico">
    <!--Import Google Icon Font-->
    <style type="text/css">
        @font-face {
            font-family: 'Material Icons';
            font-style: normal;
            font-weight: 400;
            src: url(https://fonts.gstatic.com/s/materialicons/v103/flUhRq6tzZclQEJ-Vdg-IuiaDsNcIhQ8tQ.woff2) format('woff2');
        }
        
        .material-icons {
            font-family: 'Material Icons';
            font-weight: normal;
            font-style: normal;
            font-size: 24px;
            line-height: 1;
            letter-spacing: normal;
            text-transform: none;
            display: inline-block;
            white-space: nowrap;
            word-wrap: normal;
            direction: ltr;
            -webkit-font-feature-settings: 'liga';
            -webkit-font-smoothing: antialiased;
        }
    </style>
    <!--Import materialize.css-->
    <style>
        html {
            line-height: 1.15;
            -ms-text-size-adjust: 100%;
            -webkit-text-size-adjust: 100%;
        }
        
        body {
            margin: 0;
        }
        
        html {
            -webkit-box-sizing: border-box;
            box-sizing: border-box;
        }
        
        *,
        *:before,
        *:after {
            -webkit-box-sizing: inherit;
            box-sizing: inherit;
        }
        
        html {
            line-height: 1.5;
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
            font-weight: normal;
            color: rgba(0, 0, 0, 0.87);
        }
        
        @media only screen and (min-width: 0) {
            html {
                font-size: 14px;
            }
        }
        
        @media only screen and (min-width: 992px) {
            html {
                font-size: 14.5px;
            }
        }
        
        @media only screen and (min-width: 1200px) {
            html {
                font-size: 15px;
            }
        }
    </style>
    <link type="text/css" rel="stylesheet" href="./assets/materialize/css/materialize.min.css" media="print" onload="this.media='screen,projection'"><noscript><link rel="stylesheet" href="./assets/materialize/css/materialize.min.css" media="screen,projection"></noscript>
    <!--Let browser know website is optimized for mobile-->
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="styles.31d6cfe0d16ae931b73c.css">
</head>
